import React, { Component } from 'react'
import {Link} from 'react-router-dom'
import { Container,Card,Button} from 'reactstrap'
// import SearchBar from './SearchBar';


class MainPage extends Component {
// componentDidMount(){
  // this.props.meds()
// }
  render() {
    return ( 
      <div>
        <Container>
          {/* <SearchBar meds={this.props.medlist}/> */} 
        <Card>
          <h6>Medication:</h6>
          <h6>Quontity:</h6>
          <h6>Directions:</h6>
          <h6>Refills:</h6>
          <h6>Date Written:</h6>
          <h6>Expired:</h6>
          <h6>Day Supply:</h6>
          <h6>Doctor</h6>
        </Card>
        <Button color="danger" tag={Link} to="/medinfo">Add a Med</Button>
        </Container>


      </div>
    )
  }
}

export default MainPage
